import React from "react";

const GoDown = () => {
    function scroll() {
        document.querySelector("#footer").scrollIntoView({
            behavior: "smooth",
        });
    }
    return (
        <div className="GoDown">
            <a href="#footer" onClick={() => scroll()}>
                Ë…
            </a>
        </div>
    );
};

export default GoDown;
